def calculate_victories(n, q, a, questions):
    results = []
    d = {}
    (max_id, max_first) = (1, 1)
    (head_id, head_num) = (0, a[0])
    for i in range(1, n):
        if a[i] == n:
            (max_id, max_first) = (i, i)
            break
        if a[i] > head_num:
            (head_id, head_num) = (i, a[i])
        if head_id in d:
            (first, cnt) = d[head_id]
            d[head_id] = (first, cnt + 1)
        else:
            d[head_id] = (i, 1)
    for (qid, k) in questions:
        qid = qid - 1
        if qid == max_id:
            ans = 0 if k < max_id else k - max_first + 1
        elif qid in d:
            (first, cnt) = d[qid]
            if k < first:
                ans = 0
            elif k > first + cnt - 1:
                ans = cnt
            else:
                ans = k - first + 1
        else:
            ans = 0
        results.append(ans)
    return results

